import React from 'react';
import {HouseDoor} from 'react-bootstrap-icons'
import { Link } from 'react-router-dom';


function Nav () {

    const containerStyle = {
        backgroundColor: 'rgb(85, 159, 202)',

    }

    return(
        <div style={containerStyle}>
            <button>
                <Link>
                    <HouseDoor />
                </Link>
            </button>
        </div>
    )

}

export default Nav
